import React from 'react';
import { FaUserAlt } from "react-icons/fa"; 
import { VscSignOut } from "react-icons/vsc"; 
import { Link } from "react-router-dom";

import classes from './DropDownProfile.module.css';

function DropDownProfile() { 
  return (
    <div className={classes.dropdown}>
        <ul className={classes.list}>
            <li>
            <Link to="/edit-profile" className={classes["sub-menu-link"]}>
              <div className={classes.icon}><FaUserAlt /></div>             
                <p>Edit Profile</p>
                <span>{'>'}</span>
              </Link>
            </li>
            <li>
              <a href="#" className={classes["sub-menu-link"]}>
                <div className={classes.icon}><VscSignOut /></div>
                <p>Logout</p>
                <span>{'>'}</span>
              </a>
            </li>
        </ul>
    </div>
  )
};

export default DropDownProfile;
